ISLAMABAD, Oct 23 (APP): Deputy Prime Minister/Foreign Minister Mohammad Ishaq Dar on Wednesday chaired an online meeting to review the ongoing privatization process.
The DPM/FM is currently in Samoa for the CHOGM. Ministers of Privatization, Aviation, secretaries of Privatization Division & Commission, Law, Aviation were in attendance, a post on X said.
